//       background:'black',
//     },
//   },
// });


function App() {
const matches = useMediaQuery('(min-width:600px)', { noSsr: true });

  return (

    <ThemeProvider theme={darkTheme}>
      <CssBaseline />
      <main className="App" style={{maxWidth: "30%"}}>
          <Usernames />
          <span>{`(min-width:600px) matches: ${matches}`}</span>
      </main>
    </ThemeProvider>
  );
}

export default App;
